public class Traybake extends Cake{    private int noOfSlices;    private String shape;    private String filling;    public Traybake(String baseFlavour, String type, int noOfSlices, String shape, String filling)    {        super(baseFlavour, type);        this.noOfSlices = noOfSlices;        this.shape = shape;        this.filling = filling;    }    @Override    public String isVegan()    {        return "I wish this was vegan";    }    public String hasFilling()    {        return "This traybake has a filling of " + this.filling;    }}